import React from "react";

const ComplianceRow = ({ rule, onEdit, onDelete }) => {
  return (
    <tr>
      <td>{rule.Name}</td>
      <td>{rule.Value}</td>
      <td>{rule.Description}</td>
      <td>{rule.EffectiveFrom ? rule.EffectiveFrom.slice(0, 10) : ""}</td>
      <td style={{ display: "flex", gap: "8px" }}>
        <button className="compliance-btn" onClick={() => onEdit(rule)}>Edit</button>
        <button className="compliance-btn" style={{ marginLeft: "8px" }} onClick={() => onDelete(rule.RuleID)}>Delete</button>
      </td>
    </tr>
  );
};

export default ComplianceRow;
